import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as s,o as t,G as e,k as p}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":5865,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":5865,"name":"艾尔海森","summary":"艾尔海森","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/06/25/195563531/c1c6746b3d53c687c3f570337dbecb32_1172740701584748808.png","avatar":{"m":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/16/4328207/a14e197ca3609cd41f8e4f0360cbde8b_5815338126149541153.png","pc":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/16/4328207/8c7d7c6317b98981f6c742718c737cf1_126372675920453521.png"},"attrs":[["地区","须弥城"],["星级","五星"],["神之眼所属","须弥"],["元素","草"],["武器","单手剑"],["生日","2月11日"],["所属","须弥教令院"],["定位","草元素输出角色"],["武器类型","单手剑"],["命之座","天隼座"],["称号","诲韬诤言"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/3cd9b39f3d1ccb4129f842940a52f58f_6008801920722547345.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/3cd9b39f3d1ccb4129f842940a52f58f_6008801920722547345.png\\" style=\\"width: 40px; border: \\"></span></span></span>直观</p>","<p>光幕攻击命中敌人时，将使共相·理式摹写的冷却时间减少1.2秒。该效果每1秒至多触发一次。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/67de1f246e481d6bbb544f0dd7bfa028_1596638287460815035.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/67de1f246e481d6bbb544f0dd7bfa028_1596638287460815035.png\\" style=\\"width: 40px; border: \\"></span></span></span>辩章</p>","<p>艾尔海森产生琢光镜时，每1枚产生的琢光镜将使元素精通提升50点，持续8秒。该效果最多叠加4层，每层独立计算持续时间。琢光镜数量达到上限时依然能触发该效果。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/410c9ff225c6a75efdb599918689299c_6144584493342617824.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/410c9ff225c6a75efdb599918689299c_6144584493342617824.png\\" style=\\"width: 40px; border: \\"></span></span></span>遮诠</p>","<p>共相·理式摹写的技能等级提高3级。至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/0e2744774d8e21ead16aefeba82c8764_7763259633646141377.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/0e2744774d8e21ead16aefeba82c8764_7763259633646141377.png\\" style=\\"width: 40px; border: \\"></span></span></span>义贯</p>","<p>施放殊境·显象缚结时，会依据通过本次施放消耗与产生的琢光镜数量，产生如下效果：每消耗1枚琢光镜，使队伍中附近的其他角色元素精通提升30点，持续15秒；每产生1枚琢光镜，使艾尔海森获得10%草元素伤害加成，持续15秒。上述效果的持续期间内重复施放殊境·显象缚结时，将先移除原有的效果。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/21752a64ea0de808cdbece6a9f8c18c4_3431018006390084019.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/21752a64ea0de808cdbece6a9f8c18c4_3431018006390084019.png\\" style=\\"width: 40px; border: \\"></span></span></span>智度</p>","<p>殊境·显象缚结的技能等级提高3级。至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/6d1e6003733fd4e6497b4fb8489242d8_7988096934493031480.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/09/80663279/6d1e6003733fd4e6497b4fb8489242d8_7988096934493031480.png\\" style=\\"width: 40px; border: \\"></span></span></span>正理</p>","<p>艾尔海森获得如下效果：殊境·显象缚结施放完成2秒后，将无视消耗琢光镜的个数，固定产生3枚琢光镜；艾尔海森产生琢光镜时，若琢光镜数量已达到上限，艾尔海森的暴击率提升10%，暴击伤害提升70%，持续6秒。该效果在持续期间重复触发时，剩余持续时间将增加6秒。</p>"]],"skill":[{"title":"普通攻击·溯因反绎法","desc":"普通攻击\\n进行至多五段的连续剑击。\\n\\n重击\\n消耗一定体力，瞬间向前方挥出两剑。\\n\\n下落攻击\\n从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成范围伤害。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/1741ab0b615a7f8a9929d47b23e59df2_8706943966328995188.png"},{"title":"共相·理式摹写","desc":"迅速突进，在突进结束时对身边的敌人造成草元素伤害，并凝聚「琢光镜」。\\n长按时将以不同的方式施放。\\n\\n长按\\n进入瞄准状态，以调整突进的方向。\\n\\n琢光镜\\n施放时，艾尔海森将产生1枚琢光镜； 若此时未持有任何琢光镜，则额外产生1枚。 琢光镜具有如下效果：\\n·持有琢光镜时，艾尔海森的普通攻击、重击与下落攻击将转为无法被附魔覆盖的草元素伤害；\\n·上述攻击命中敌人时，琢光镜将进行光幕攻击，造成基于琢光镜数量的草元素范围伤害；\\n·至多持有3枚琢光镜；\\n·琢光镜将随着时间流逝逐枚消失，并将在艾尔海森退场时全部消失。\\n\\n「真理本就存在于不确定性当中，即便再伟大的学者也不能免于错谬。」","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/9b4c2b6df1e02063a11fc2018e2f4efe_6567066389662843691.png"},{"title":"殊境·显象缚结","desc":"创造殊相缚境，造成多次草元素范围伤害。\\n施放时，若持有琢光镜，将消耗所有的琢光镜，增加造成伤害的次数。\\n施放完成2秒后，若施放时消耗了0/1/2/3个琢光镜，则将为艾尔海森产生3/2/1/0个琢光镜。\\n\\n「学者如果将追求智慧作为自己的目标，那么他就必须与他所读到的每一个字为敌，这样才有可能免于偏见。」","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/4dfd56b4eaf45ed914df5016ae868d45_3321037916035615736.png"},{"title":"四因订顽","desc":"艾尔海森的重击或下落攻击命中敌人时，将产生一枚琢光镜。 该效果每12秒至多触发一次。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/af4a9ab2e5dea89e64d629ad1950b1f7_1930826479472731111.png"},{"title":"谜林道破","desc":"艾尔海森的每点元素精通，都会使光幕伤害与殊境·显象缚结造成的伤害提升0.1%。\\n通过这种方式，至多使光幕伤害与殊境·显象缚结造成的伤害提升100%。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/faaa3f4395579e7dc44257709a2d76c7_2139301948436716943.png"},{"title":"超定归约律","desc":"合成武器突破素材时，有10%概率获得2倍产出。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2023/01/17/4328207/5d6eed815620e37f0c45af999a465c1b_2010251624446297308.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/5865.md","filePath":"game/ys/role/[pkg].md"}'),c={name:"game/ys/role/5865.md"},g=Object.assign(c,{setup(o){return(i,d)=>(t(),s("div",null,[e(p(a))]))}});export{r as __pageData,g as default};
